import React from 'react';
import './main.css';
import { Layout, Header, Navigation, Drawer, Content} from 'react-mdl';
import Main from './components/main';
import {Link} from 'react-router-dom';

function App() {
  return (
    <div className="demo-big-content">
    <Layout>
        <Header className="gui gui_top" title="Title" scroll>
            <Navigation className="gui__nav nav">
                <Link to="/resume" className="nav__item">Resume</Link>
                <Link to="/aboutme" classname="nav__item">About Me</Link>
                <Link to="/projects" className="nav__item">Projects</Link>
                <Link to="/contact" className="nav__item">Contact</Link>
            </Navigation>
        </Header>
        <Drawer title="Title">
            <Navigation>
            <Link to="/resume">Resume</Link>
                <Link to="/aboutme">About Me</Link>
                <Link to="/projects">Projects</Link>
                <Link to="/contact">Contact</Link>
            </Navigation>
        </Drawer>
        <Content>
            <div className="page-content" />
            <Main />
        </Content>
    </Layout>
</div>
  );
}

export default App;
